// Este script se adjunta a la DirectionalLight (Key Light)

// ----------------------------------------------------
// VARIABLES DE PALETA BASE (Definidas por Cdigo)
// Usamos THREE.Color para la transicin suave
const DAY_COLOR = new THREE.Color(0xFFFFFF);     // Blanco puro (Medioda)
const SUNSET_COLOR = new THREE.Color(0xFF8800);  // Naranja clido (Atardecer/Amanecer)
// ----------------------------------------------------

// Variables de control de tiempo que persisten en el objeto 'this'
if (this.customTime === undefined) {
    this.customTime = 0;
}
const SPEED = 0.002; // Velocidad de la animacin

function update(dt) {
    // Incrementa el tiempo para el movimiento continuo
    this.customTime += SPEED; 

    // 1. ROTACIN: Anima el movimiento del sol en un arco (eje X)
    // Math.sin(time) genera un valor que oscila entre -1 y 1.
    const rotationAngle = Math.sin(this.customTime) * 1.5; // El '1.5' ajusta la amplitud del arco
    this.rotation.x = rotationAngle;

    // 2. CLCULO DEL FACTOR DE TRANSICIN
    // Usamos Math.abs(Math.cos()) para obtener un valor entre 0 (Atardecer) y 1 (Medioda)
    // Esto vincula el color al ngulo de rotacin.
    const colorFactor = Math.abs(Math.cos(this.customTime)); 

    // 3. COLOR (Paleta Base Animada)
    // Combina el color de atardecer con el color del da segn el factor.
    this.color.lerpColors(SUNSET_COLOR, DAY_COLOR, colorFactor);

    // NOTA: La intensidad (this.intensity) no se modifica, permanece constante.
}

