var scaleSpeed = 0.0001; // Velocidad de alejamiento

function update() {
    // Rotar la escena
    this.rotation.y += 0.0008;

    // Reducir la escala gradualmente (alejar)
    this.scale.x -= scaleSpeed;
    this.scale.y -= scaleSpeed;
    this.scale.z -= scaleSpeed;

    // Evitar que se haga demasiado pequea
    if (this.scale.x < 0.5) {
        this.scale.set(0.5, 0.5, 0.5);

    }
}

function update() {

    // Crear color inicial azul
    if (!this.background) {
        this.background = new THREE.Color(0.3, 0.5, 0.9); // Azul medio
        this.backgroundDir = -0.0003;
    }

    if (!this.backgroundDir) {
        this.backgroundDir = -0.0003;
    }

    // Cambiar solo mantenindolo azul
    this.background.r += this.backgroundDir ; // Menos rojo
    this.background.g += this.backgroundDir ; // Medio verde
    this.background.b += this.backgroundDir;       // Mantener azul alto

    // Invertir al llegar a los lmites (azul oscuro y azul claro)
    if (this.background.b < 0.5) {
        this.backgroundDir = 0.0003; // Aclarar
    }
    if (this.background.b > 0.8) {
        this.backgroundDir = -0.0003; // Oscurecer
    }
}
